import styled from "styled-components"


export const Container = styled.header`
    height: 80px;
`;

export const Content = styled.div`
    max-width: auto;
    margin: 0;

`;

export const Header = styled.div`

    h1{
        font-weight: 700;
        font-size: 40px;
    }

`;
